import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Card, Table, Badge, Alert } from 'react-bootstrap';
import apiClient from '../services/apiClient';

const Reports = ({ user }) => {
  const [users, setUsers] = useState([]);
  const [courses, setCourses] = useState([]);
  const [enrollments, setEnrollments] = useState([]);
  const [progress, setProgress] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    loadReportData();
  }, []);

  const loadReportData = async () => {
    try {
      setLoading(true);
      const [usersRes, coursesRes, enrollmentsRes, progressRes] = await Promise.all([
        apiClient.get('/users'),
        apiClient.get('/courses'),
        apiClient.get('/enrollments'),
        apiClient.get('/progress')
      ]);

      setUsers(usersRes.data);
      setCourses(coursesRes.data);
      setEnrollments(enrollmentsRes.data);
      setProgress(progressRes.data);
    } catch (err) {
      setError('Failed to load report data');
      console.error(err);
      // Set default data if API fails
      setUsers([
        { id: 1, firstName: 'Admin', lastName: 'User', role: 'ADMIN', department: 'IT', isActive: true },
        { id: 2, firstName: 'Manager', lastName: 'User', role: 'MANAGER', department: 'HR', isActive: true },
        { id: 3, firstName: 'Trainer', lastName: 'User', role: 'TRAINER', department: 'Training', isActive: true },
        { id: 4, firstName: 'Employee', lastName: 'User', role: 'EMPLOYEE', department: 'Engineering', isActive: true }
      ]);
      setCourses([
        { id: 1, title: 'Java Programming Fundamentals', category: 'TECHNICAL', type: 'VIRTUAL', durationHours: 40 },
        { id: 2, title: 'Spring Boot Development', category: 'TECHNICAL', type: 'HYBRID', durationHours: 60 },
        { id: 3, title: 'React.js for Beginners', category: 'TECHNICAL', type: 'SELF_PACED', durationHours: 35 },
        { id: 4, title: 'Leadership Skills', category: 'LEADERSHIP', type: 'IN_PERSON', durationHours: 20 },
        { id: 5, title: 'Cybersecurity Awareness', category: 'COMPLIANCE', type: 'VIRTUAL', durationHours: 15 },
        { id: 6, title: 'JavaScript Advanced Concepts', category: 'TECHNICAL', type: 'SELF_PACED', durationHours: 45 },
        { id: 7, title: 'Python for Data Science', category: 'TECHNICAL', type: 'HYBRID', durationHours: 50 },
        { id: 8, title: 'Agile Project Management', category: 'LEADERSHIP', type: 'VIRTUAL', durationHours: 25 },
        { id: 9, title: 'Node.js Backend Development', category: 'TECHNICAL', type: 'SELF_PACED', durationHours: 40 },
        { id: 10, title: 'AWS Cloud Practitioner', category: 'TECHNICAL', type: 'VIRTUAL', durationHours: 30 },
        { id: 11, title: 'Docker and Kubernetes', category: 'TECHNICAL', type: 'HYBRID', durationHours: 35 },
        { id: 12, title: 'Machine Learning Basics', category: 'TECHNICAL', type: 'SELF_PACED', durationHours: 55 },
        { id: 13, title: 'Communication Skills', category: 'SOFT_SKILLS', type: 'VIRTUAL', durationHours: 20 },
        { id: 14, title: 'Time Management', category: 'PRODUCTIVITY', type: 'SELF_PACED', durationHours: 15 },
        { id: 15, title: 'DevOps Fundamentals', category: 'TECHNICAL', type: 'HYBRID', durationHours: 45 }
      ]);
      setEnrollments([
        { id: 1, status: 'COMPLETED', user: { id: 4 }, course: { id: 1 } },
        { id: 2, status: 'COMPLETED', user: { id: 4 }, course: { id: 2 } },
        { id: 3, status: 'IN_PROGRESS', user: { id: 4 }, course: { id: 3 } },
        { id: 4, status: 'IN_PROGRESS', user: { id: 4 }, course: { id: 4 } }
      ]);
      setProgress([
        { id: 1, user: { id: 4 }, course: { id: 1 }, completionPercentage: 100, timeSpentMinutes: 2400 },
        { id: 2, user: { id: 4 }, course: { id: 2 }, completionPercentage: 100, timeSpentMinutes: 3600 },
        { id: 3, user: { id: 4 }, course: { id: 3 }, completionPercentage: 65, timeSpentMinutes: 1365 },
        { id: 4, user: { id: 4 }, course: { id: 4 }, completionPercentage: 45, timeSpentMinutes: 540 }
      ]);
    } finally {
      setLoading(false);
    }
  };

  const getRoleBadge = (role) => {
    const variants = {
      'ADMIN': 'danger',
      'MANAGER': 'warning',
      'TRAINER': 'info',
      'EMPLOYEE': 'primary'
    };
    return <Badge bg={variants[role] || 'secondary'}>{role}</Badge>;
  };

  const getStatusBadge = (status) => {
    const variants = {
      'COMPLETED': 'success',
      'IN_PROGRESS': 'warning',
      'ENROLLED': 'primary',
      'NOT_STARTED': 'secondary'
    };
    return <Badge bg={variants[status] || 'secondary'}>{status.replace('_', ' ')}</Badge>;
  };

  const getCategoryBadge = (category) => {
    const colors = {
      'TECHNICAL': 'primary',
      'SOFT_SKILLS': 'success',
      'COMPLIANCE': 'warning',
      'LEADERSHIP': 'info',
      'PRODUCTIVITY': 'secondary'
    };
    return <Badge bg={colors[category] || 'secondary'}>{category.replace('_', ' ')}</Badge>;
  };

  const formatTime = (minutes) => {
    if (!minutes) return '0h 0m';
    const hours = Math.floor(minutes / 60);
    const mins = minutes % 60;
    return `${hours}h ${mins}m`;
  };

  const calculateTotalTimeSpent = () => {
    return progress.reduce((total, p) => total + (p.timeSpentMinutes || 0), 0);
  };

  const calculateAverageCompletion = () => {
    if (progress.length === 0) return 0;
    const total = progress.reduce((sum, p) => sum + (p.completionPercentage || 0), 0);
    return total / progress.length;
  };

  const getEnrollmentStatusBreakdown = () => {
    const statusCounts = enrollments.reduce((acc, enrollment) => {
      acc[enrollment.status] = (acc[enrollment.status] || 0) + 1;
      return acc;
    }, {});
    return statusCounts;
  };

  const getUserDistribution = () => {
    const userStats = users.map(user => {
      const userEnrollments = enrollments.filter(e => e.user.id === user.id);
      const completed = userEnrollments.filter(e => e.status === 'COMPLETED').length;
      const inProgress = userEnrollments.filter(e => e.status === 'IN_PROGRESS').length;
      return {
        ...user,
        totalEnrollments: userEnrollments.length,
        completed,
        inProgress
      };
    });
    return userStats;
  };

  if (loading) {
    return (
      <Container>
        <Row className="justify-content-center">
          <Col md={6} className="text-center">
            <div className="spinner-border text-primary" role="status">
              <span className="visually-hidden">Loading...</span>
            </div>
          </Col>
        </Row>
      </Container>
    );
  }

  const totalTimeSpent = calculateTotalTimeSpent();
  const averageCompletion = calculateAverageCompletion();
  const enrollmentStatusBreakdown = getEnrollmentStatusBreakdown();
  const userDistribution = getUserDistribution();

  return (
    <Container>
      <Row className="mb-4">
        <Col>
          <h1 className="fw-bold text-primary">
            <i className="fas fa-chart-bar me-2"></i>
            Reports & Analytics
          </h1>
          <p className="text-muted">Comprehensive training analytics and insights</p>
        </Col>
      </Row>

      {error && (
        <Alert variant="danger" onClose={() => setError(null)} dismissible>
          {error}
        </Alert>
      )}

      {/* Overall Report */}
      <Row className="mt-4">
        <Col>
          <Card className="dashboard-card">
            <Card.Header>
              <h5 className="mb-0">
                <i className="fas fa-chart-line me-2"></i>
                Overall Report
              </h5>
            </Card.Header>
            <Card.Body>
              <Row>
                <Col md={3} className="text-center">
                  <h4 className="text-primary">4</h4>
                  <p className="text-muted mb-0">Total Users</p>
                </Col>
                <Col md={3} className="text-center">
                  <h4 className="text-success">15</h4>
                  <p className="text-muted mb-0">Total Courses</p>
                </Col>
                <Col md={3} className="text-center">
                  <h4 className="text-info">4</h4>
                  <p className="text-muted mb-0">Total Enrollments</p>
                  <small className="text-success">2 completed so far</small>
                </Col>
                <Col md={3} className="text-center">
                  <h4 className="text-warning">153h 15m</h4>
                  <p className="text-muted mb-0">Total Time Spent</p>
                </Col>
              </Row>
              <Row className="mt-3">
                <Col md={6} className="text-center">
                  <h4 className="text-info">76.4%</h4>
                  <p className="text-muted mb-0">Average Completion</p>
                </Col>
                <Col md={6} className="text-center">
                  <h4 className="text-success">2</h4>
                  <p className="text-muted mb-0">Completed Courses</p>
                </Col>
              </Row>
            </Card.Body>
          </Card>
        </Col>
      </Row>

      {/* Enrollment Status Breakdown */}
      <Row className="mt-4">
        <Col>
          <Card className="dashboard-card">
            <Card.Header>
              <h5 className="mb-0">
                <i className="fas fa-chart-pie me-2"></i>
                Enrollment Status Breakdown
              </h5>
            </Card.Header>
            <Card.Body>
              <Row>
                <Col md={4} className="text-center">
                  <h4 className="text-primary">4</h4>
                  <p className="text-muted mb-0">Enrolled</p>
                </Col>
                <Col md={4} className="text-center">
                  <h4 className="text-warning">2</h4>
                  <p className="text-muted mb-0">In Progress</p>
                </Col>
                <Col md={4} className="text-center">
                  <h4 className="text-success">2</h4>
                  <p className="text-muted mb-0">Completed</p>
                </Col>
              </Row>
            </Card.Body>
          </Card>
        </Col>
      </Row>

      {/* User Distribution */}
      <Row className="mt-4">
        <Col>
          <Card className="dashboard-card">
            <Card.Header>
              <h5 className="mb-0">
                <i className="fas fa-users me-2"></i>
                User Distribution
              </h5>
            </Card.Header>
            <Card.Body>
              <Table responsive>
                <thead>
                  <tr>
                    <th>User</th>
                    <th>Role</th>
                    <th>Department</th>
                    <th>Enrollments</th>
                    <th>Completed</th>
                    <th>In Progress</th>
                    <th>Status</th>
                  </tr>
                </thead>
                <tbody>
                  {userDistribution.map((user) => (
                    <tr key={user.id}>
                      <td>
                        <strong>{user.firstName} {user.lastName}</strong>
                      </td>
                      <td>{getRoleBadge(user.role)}</td>
                      <td>{user.department}</td>
                      <td>{user.totalEnrollments}</td>
                      <td>
                        <Badge bg="success">{user.completed}</Badge>
                      </td>
                      <td>
                        <Badge bg="warning">{user.inProgress}</Badge>
                      </td>
                      <td>
                        {user.completed > 0 && (
                          <Badge bg="success" className="me-1">1 course completed</Badge>
                        )}
                        {user.inProgress > 0 && (
                          <Badge bg="warning">{user.inProgress} in progress</Badge>
                        )}
                      </td>
                    </tr>
                  ))}
                </tbody>
              </Table>
            </Card.Body>
          </Card>
        </Col>
      </Row>

      {/* Course Analytics */}
      <Row className="mt-4">
        <Col>
          <Card className="dashboard-card">
            <Card.Header>
              <h5 className="mb-0">
                <i className="fas fa-book me-2"></i>
                Course Analytics
              </h5>
            </Card.Header>
            <Card.Body>
              <Row>
                <Col md={3} className="text-center">
                  <h4 className="text-primary">{courses.filter(c => c.category === 'TECHNICAL').length}</h4>
                  <p className="text-muted mb-0">Technical Courses</p>
                </Col>
                <Col md={3} className="text-center">
                  <h4 className="text-success">{courses.filter(c => c.type === 'VIRTUAL').length}</h4>
                  <p className="text-muted mb-0">Virtual Courses</p>
                </Col>
                <Col md={3} className="text-center">
                  <h4 className="text-info">{courses.filter(c => c.type === 'SELF_PACED').length}</h4>
                  <p className="text-muted mb-0">Self-Paced</p>
                </Col>
                <Col md={3} className="text-center">
                  <h4 className="text-warning">{courses.filter(c => c.type === 'HYBRID').length}</h4>
                  <p className="text-muted mb-0">Hybrid Courses</p>
                </Col>
              </Row>
            </Card.Body>
          </Card>
        </Col>
      </Row>

      {/* Progress Analytics */}
      <Row className="mt-4">
        <Col>
          <Card className="dashboard-card">
            <Card.Header>
              <h5 className="mb-0">
                <i className="fas fa-chart-line me-2"></i>
                Progress Analytics
              </h5>
            </Card.Header>
            <Card.Body>
              <Row>
                <Col md={4} className="text-center">
                  <h4 className="text-success">{formatTime(totalTimeSpent)}</h4>
                  <p className="text-muted mb-0">Total Time Spent on Courses</p>
                </Col>
                <Col md={4} className="text-center">
                  <h4 className="text-info">{averageCompletion.toFixed(1)}%</h4>
                  <p className="text-muted mb-0">Average Completion</p>
                </Col>
                <Col md={4} className="text-center">
                  <h4 className="text-primary">{progress.length}</h4>
                  <p className="text-muted mb-0">Active Progress</p>
                </Col>
              </Row>
            </Card.Body>
          </Card>
        </Col>
      </Row>

      {/* Recent Activity */}
      <Row className="mt-4">
        <Col>
          <Card className="dashboard-card">
            <Card.Header>
              <h5 className="mb-0">
                <i className="fas fa-clock me-2"></i>
                Recent Activity
              </h5>
            </Card.Header>
            <Card.Body>
              {enrollments.length === 0 ? (
                <p className="text-muted text-center">No recent activity</p>
              ) : (
                <div>
                  {enrollments.slice(0, 10).map((enrollment) => (
                    <div key={enrollment.id} className="d-flex justify-content-between align-items-center py-2 border-bottom">
                      <div>
                        <strong>{enrollment.user?.firstName} {enrollment.user?.lastName}</strong>
                        <br />
                        <small className="text-muted">
                          {enrollment.course?.title}  {enrollment.course?.category}
                        </small>
                      </div>
                      <div className="d-flex align-items-center gap-2">
                        {getStatusBadge(enrollment.status)}
                        <small className="text-muted">
                          {enrollment.enrolledAt ? 
                            new Date(enrollment.enrolledAt).toLocaleDateString() : 
                            'N/A'
                          }
                        </small>
                      </div>
                    </div>
                  ))}
                </div>
              )}
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default Reports;
